import React from 'react';
import logo from './logo.svg';
import './App.css';
import Test from './pages/test';

function App() {
  return (
    <>
    <BrowserRouter>
      <Header />

      <main>
        <Routes>
          <Route path="/" element={<HomePage />}></Route>
          <Route path="show-all" element={<ShowAllPage />}></Route>
          <Route path="search-games" element={<SearchPage />}></Route>
          <Route
            path="add-games"
            element={<AddEditOrDeleteGamePage />}
          ></Route>
        </Routes>
      </main>
    </BrowserRouter>
  </>
  );
}

export default App;
